INSERT INTO `zbp_post` VALUES (5,0,1,'',0,1,'about',0,1,'关于','','<p>这是一枚曾经给移动打了一年工的老学长留给学弟学妹们的礼物~</p><p><br/></p><p>另外，由于我不在学校，所以移动宽带变化的时候，我并不知道，网站也不会更新，希望大家可以在移动宽带变化的时候通知我一声，邮箱：oliver.csu@gmail.com，微信也行～</p><p><br/></p><p>最后，这枚学长单身，可撩，右下角有微信哈～<br/></p>',1494924231,0,636,'',''),(6,3,1,'',0,0,'',0,1,'如何通过锐捷VPN客户端下载论文','本文介绍中南大学移动宽带（和网）如何通过锐捷VPN客户端免费下载文献。锐捷VPN客户端下载地址：&nbsp;&nbsp;&nbsp;&nbsp;32位&nbsp;&nbsp;&nbsp;&nbsp;64位1.下载与系统相对应的32位或64位的客户端，双击客户端打开安装向导。2.勾选“是的，我已经阅读并同意”，点击“下一步”。&nbsp;3.全点“下一步”，直到安装。4.点击“安装”，进行安装。5.在桌面找到锐捷VPN客户端，双击打开客户端。6.点击“配置VPN”。7.进入“配置VPN”后，连接名<!--autointro-->','<p>本文介绍中南大学移动宽带（和网）如何通过锐捷VPN客户端免费下载文献。</p><p><br/></p><p><strong>锐捷VPN客户端下载地址：</strong>&nbsp;&nbsp;&nbsp;&nbsp;<a href=\"/go.php?url=https://pan.lanzou.com/1159916\" target=\"_blank\" textvalue=\"32位\">32位</a>&nbsp;&nbsp;&nbsp;&nbsp;<a href=\"/go.php?url=https://pan.lanzou.com/1159917\" target=\"_blank\" textvalue=\"64位\">64位</a><br/></p><p><br/></p><p>1.下载与系统相对应的32位或64位的客户端，双击客户端打开安装向导。<br/></p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705161494926334208190.png\" title=\"06-01.png\" alt=\"06-01.png\"/></p><p>2.勾选“是的，我已经阅读并同意”，点击“下一步”。&nbsp;</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705161494926415186890.png\" title=\"06-02.png\" alt=\"06-02.png\"/></p><p>3.全点“下一步”，直到安装。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705161494926452190669.png\" title=\"06-03.png\" alt=\"06-03.png\"/></p><p>4.点击“安装”，进行安装。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705161494926485104528.png\" title=\"06-04.png\" alt=\"06-04.png\" width=\"500\" height=\"257\" style=\"width: 500px; height: 257px;\"/></p><p>5.在桌面找到锐捷VPN客户端，双击打开客户端。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705161494926539107476.png\" title=\"06-05.png\" alt=\"06-05.png\" width=\"500\" height=\"259\" style=\"width: 500px; height: 259px;\"/></p><p>6.点击“配置VPN”。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705161494926584115743.png\" title=\"06-06.png\" alt=\"06-06.png\" width=\"498\" height=\"254\" style=\"width: 498px; height: 254px;\"/></p><p>7.进入“配置VPN”后，连接名填写“中南大学”，类型选择“SSL—VPN”，描述留空，远程网关配置为“111.8.49.138”，勾选“自定义端口”，端口号为“10443”，勾选“遇到无效的服务器证书不提示”，点击确定。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705161494926631169838.png\" title=\"06-07.png\" alt=\"06-07.png\" width=\"499\" height=\"357\" style=\"width: 499px; height: 357px;\"/></p><p>8.VPN客户端已经配置完成，但账号和密码不是移动宽带的密码，账号密码见下表。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705161494926699114040.png\" title=\"06-08.png\" alt=\"06-08.png\" width=\"500\" height=\"348\" style=\"width: 500px; height: 348px;\"/></p><p><br/></p><table interlaced=\"disabled\" data-sort=\"sortDisabled\" align=\"center\"><caption style=\"border-color: rgb(221, 221, 221);\">&nbsp;账号一览表</caption><tbody><tr class=\"firstRow\"><td width=\"86\" valign=\"top\" style=\"border: 1px solid rgb(221, 221, 221); border-image-source: none; background-color: rgb(170, 170, 170);\" align=\"center\" height=\"19\">csu001<br/></td><td width=\"86\" valign=\"top\" style=\"border: 1px solid rgb(221, 221, 221); border-image-source: none; background-color: rgb(170, 170, 170);\" height=\"19\" align=\"center\">csu002<br/></td><td width=\"86\" valign=\"top\" style=\"border: 1px solid rgb(221, 221, 221); border-image-source: none; background-color: rgb(170, 170, 170);\" height=\"19\" align=\"center\">csu003<br/></td><td width=\"86\" valign=\"top\" style=\"border: 1px solid rgb(221, 221, 221); border-image-source: none; background-color: rgb(170, 170, 170);\" height=\"19\" align=\"center\">csu004<br/></td><td width=\"86\" valign=\"top\" style=\"border: 1px solid rgb(221, 221, 221); border-image-source: none; background-color: rgb(170, 170, 170);\" height=\"19\" align=\"center\">csu005<br/></td><td width=\"86\" valign=\"top\" style=\"border: 1px solid rgb(221, 221, 221); border-image-source: none; background-color: rgb(170, 170, 170);\" height=\"19\" align=\"center\">csu006<br/></td><td width