"/></p><p>5.密码的修改。我想大家应该很在乎密码的修改，因为密码是123456真的是太容易被别人利用了，所以这里教大家修改下宽带的密码。修改宽带的密码需要登陆宽带的自助系统，在自助系统里面不仅可以修改密码，还可以修改个人信息。当然，还有个网络保修功能，不过使用这个来保修是没有人回复的，大家不要使用。自助营业厅的地址是：自助系统。这个地址必须在内网打开，不能在其他地方访问，而且不能挂任何的代理，比如VPN等。当然，客户端上面也是有快捷方式的，我们可以直接点击。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495093408180172.png\" style=\"width: 600px; height: 421px;\" title=\"8-04.png\" width=\"600\" height=\"421\" border=\"0\" vspace=\"0\" alt=\"8-04.png\"/></p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495093408893698.png\" style=\"width: 600px; height: 421px;\" title=\"8-03.png\" width=\"600\" height=\"421\" border=\"0\" vspace=\"0\" alt=\"8-03.png\"/></p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495093408517088.png\" style=\"width: 600px; height: 328px;\" title=\"8-05.png\" width=\"600\" height=\"328\" border=\"0\" vspace=\"0\" alt=\"8-05.png\"/></p><p>6.登陆自助系统之后，在左上角有个个人信息和修改密码。这样就可以修改个人信息和密码了，密码是可以包含英文字母的，而且不一定要6位数字。个人信息也是可以修改的，如果发现自己的个人信息不正确，请大家进行修改，应该是开学工作人员太忙了，就没全部录入进去。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495093472157117.png\" title=\"8-06.png\" alt=\"8-06.png\" width=\"600\" height=\"330\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 330px;\"/></p><p>7.退出系统。修改成功后，点击右上角的退出即可退出系统。</p><p>如果觉得本站对您有一定的帮助，请到<a href=\"/donate.html\" target=\"_self\">捐助支持</a>页面帮助站长一次，以便我们可持续发展~</p>',1495092827,0,320,'',''),(7,3,1,'',0,0,'',0,1,'如何禁止锐捷VPN客户端开机自启动','\r\n    本文介绍如何修改Windows设置来禁止锐捷VPN客户端开机自启动，适用于中南大学移动宽带（和网）VPN客户端。\r\n\r\n\r\n    \r\n\r\n\r\n    1.右键计算机，选择“管理”。\r\n\r\n\r\n    \r\n\r\n\r\n    2.双击“服务”。\r\n\r\n\r\n    \r\n\r\n\r\n    3.在服务里面找到“RG NGFW VPNClient Service Scheduler”。\r\n\r\n\r\n    \r\n\r\n\r\n    4.右键这一项，选择属性。\r\n\r\n\r\n    \r\n\r\n\r\n    5.将“<!--autointro-->','<p>\r\n    本文介绍如何修改Windows设置来禁止锐捷VPN客户端开机自启动，适用于中南大学移动宽带（和网）VPN客户端。\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>\r\n<p>\r\n    1.右键计算机，选择“管理”。\r\n</p>\r\n<p>\r\n    <img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495089821201311.png\" title=\"7-01.png\" alt=\"7-01.png\" width=\"600\" height=\"429\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 429px;\"/>\r\n</p>\r\n<p>\r\n    2.双击“服务”。\r\n</p>\r\n<p>\r\n    <img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495089878386474.png\" title=\"7-02.png\" alt=\"7-02.png\" width=\"600\" height=\"429\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 429px;\"/>\r\n</p>\r\n<p>\r\n    3.在服务里面找到“RG NGFW VPNClient Service Scheduler”。\r\n</p>\r\n<p>\r\n    <img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495089896441543.png\" title=\"7-03.png\" alt=\"7-03.png\" width=\"600\" height=\"429\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 429px;\"/>\r\n</p>\r\n<p>\r\n    4.右键这一项，选择属性。\r\n</p>\r\n<p>\r\n    <img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495089912649064.png\" title=\"7-04.png\" alt=\"7-04.png\" width=\"600\" height=\"429\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 429px;\"/>\r\n</p>\r\n<p>\r\n    5.将“启动类型”改成“手动”，再点击确定。\r\n</p>\r\n<p>\r\n    <img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495089929105595.png\" title=\"7-05.png\" alt=\"7-05.png\"/>\r\n</p>\r\n<p>\r\n    6.关闭所有打开的窗口，下次开机就不会自动启动VPN客户端了。\r\n</p>\r\n<p>\r\n    如果觉得本站对您有一定的帮助，请到<a href=\"/donate.html\" target=\"_self\">捐助支持</a>页面帮助站长一次，以便我们可持续发展~\r\n</p>',1495089498,0,670,'','a:2:{s:11:\"tc_keywords\";s:30:\"锐捷客户端开机自启动\";s:14:\"tc_description\";s:142:\"本文介绍如何修改Windows设置来禁止锐捷VPN客户端开机自启动，适用于中南大学移动宽带（和网）VPN客户端。\";}'),(9,2,1,'',0,0,'',0,1,'宽带使用教程（网页版）','本文介绍中南大学移动宽带（和网）的网页认证如何使用。1.首先用一根长度合适的网线将移动的插口和电脑的网线插口连起来。如果电脑没有网线插口，请买一个RG45插口转USB插口的转换器。2.打开一个浏览器，一般就会弹出登陆界面了。但有些时候也会弹不出登陆界面，这时候可以访问http://172.1.0.2，应该就会有登陆界面了。3.将登陆界面保存到浏览器的书签，以防以后访问http://172.1.0.2的时候也不弹出登陆界面，使用路由器的用户这里一定要这样做。4.输入账号和密码登陆，服务使用默认的I<!--autointro-->','<p>本文介绍中南大学移动宽带（和网）的网页认证如何使用。</p><p><br/></p><p>1.首先用一根长度合适的网线将移动的插口和电脑的网线插口连起来。如果电脑没有网线插口，请买一个RG45插口转USB插口的转换器。</p><p>2.打开一个浏览器，一般就会弹出登陆界面了。但有些时候也会弹不出登陆界面，这时候可以访问<a href=\"/go.php?url=http://172.1.0.2\" target=\"_blank\">http://172.1.0.2</a>，应该就会有登陆界面了。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495105126612242.png\" title=\"9-01.png\" alt=\"9-01.png\" width=\"600\" height=\"328\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 328px;\"/></p><p>3.将登陆界面保存到浏览器的书签，以防以后访问<a href=\"/go.php?url=http://172.1.0.2\" target=\"_blank\">http://172.1.0.2</a>的时候也不弹出登陆界面，使用路由器的用户这里一定要这样做。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495105147129935.png\" title=\"9-02.png\" alt=\"9-02.png\" width=\"600\" height=\"370\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 370px;\"/></p><p>4.输入账号和密码登陆，服务使用默认的Internet，不是使用校园网。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495105206682068.png\" title=\"9-03.png\" alt=\"9-03.png\" width=\"600\" height=\"328\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 328px;\"/></p><p>5.登陆成功。建议不要关闭这个界面，下线的时候尽量通过点击“我要下线”下线，为了减少不必要的麻烦。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495105228197261.png\" title=\"9-04.png\" alt=\"9-04.png\" width=\"600\" height=\"238\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 238px;\"/></p><p>6.密码的修改。我想大家应该很在乎密码的修改，因为密码是123456真的是太容易被别人利用了，所以这里教大家修改下宽带的密码。修改宽带的密码需要登陆宽带的自助系统，在自助系统里面不仅可以修改密码，还可以修改个人信息。当然，还有个网络保修功能，不过使用这个来保修是没有人回复的，大家不要使用。自助营业厅的地址是：<a href=\"/go.php?url=http://172.16.0.100:8080/selfservice/\" target=\"_blank\">http://172.16.0.100:8080/selfservice/</a>。这个地址必须在内网打开，不能在其他地方访问，而且不能挂任何的代理，比如VPN等。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495105253443299.png\" title=\"9-05.png\" alt=\"9-05.png\" width=\"600\" height=\"328\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 328px;\"/></p><p>7.登陆自助系统之后，在左上角有个个人信息和修改密码。这样就可以修改个人信息和密码了，密码是可以包含英文字母的，不一定要6位数字。个人信息也是可以修改的，如果发现自己的个人信息不正确，请大家进行修改，应该是开学工作人员太忙了，就没全部录入进去。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495105275133706.png\" title=\"9-06.png\" alt=\"9-06.png\" width=\"600\" height=\"330\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 330px;\"/></p><p>8.退出系统。修改成功后，点击右上角的退出即可退出系统。</p><p>如果觉得本站对您有一定的帮助，请到<a href=\"/donate.html\" target=\"_self\">捐助支持</a>页面帮助站长一次，以便我们可持续发展~</p>',1495104658,0,953,'','a:1:{s:14:\"tc_description\";s:78:\"本文介绍中南大学移动宽带（和网）的网页认证如何使用。\";}'),(10,2,1,'',0,0,'',0,1,'如何使用电脑给手机和平板开Wi-Fi','本文介绍中南大学移动宽带（和网）如何使用电脑给手机和平板开Wi-Fi。前提准备：电脑需要有一块无线网卡或者有个随身Wi-Fi，比如360随身Wi-Fi，小米随身Wi-Fi，百度随身Wi-Fi，并且安装了所需的驱动，并且打开了Wi-Fi的开关。这个驱动主要针对电脑的无线网卡而言，一般装完系统就已经安装好了驱动，如果实在没有驱动程序，建议使用360驱动大师进行安装。至于如何打开Wi-Fi的开关，Win7需要用到热键，具体看自己笔记本电脑的键盘；Win8和Win10可以直接点击屏幕右下角的网络图标，就<!--autointro-->','<p>本文介绍中南大学移动宽带（和网）如何使用电脑给手机和平板开Wi-Fi。</p><p><br/></p><p>前提准备：电脑需要有一块无线网卡或者有个随身Wi-Fi，比如360随身Wi-Fi，小米随身Wi-Fi，百度随身Wi-Fi，并且安装了所需的驱动，并且打开了Wi-Fi的开关。这个驱动主要针对电脑的无线网卡而言，一般装完系统就已经安装好了驱动，如果实在没有驱动程序，建议使用360驱动大师进行安装。至于如何打开Wi-Fi的开关，Win7需要用到热键，具体看自己笔记本电脑的键盘；Win8和Win10可以直接点击屏幕右下角的网络图标，就可以看到Wi-Fi的开关了。</p><p><br/></p><p>1.下载猎豹Wi-Fi，官网为：http://wifi.liebao.cn。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495106871207547.png\" title=\"10-01.png\" alt=\"10-01.png\" width=\"600\" height=\"284\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 284px;\"/></p><p>2.双击安装包，进行安装。如果不喜欢把软件安装到C盘，这里可以自行修改安装路径。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495106895208850.png\" style=\"width: 600px; height: 241px;\" title=\"10-02.png\" width=\"600\" height=\"241\" border=\"0\" vspace=\"0\" alt=\"10-02.png\"/></p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495106895111739.png\" style=\"width: 600px; height: 241px;\" title=\"10-03.png\" width=\"600\" height=\"241\" border=\"0\" vspace=\"0\" alt=\"10-03.png\"/></p><p>3.安装成功，设置Wi-Fi的名字和密码。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495106941716610.png\" style=\"width: 600px; height: 391px;\" title=\"10-05.png\" width=\"600\" height=\"391\" border=\"0\" vspace=\"0\" alt=\"10-05.png\"/></p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495106941683143.png\" style=\"width: 600px; height: 636px;\" title=\"10-04.png\" width=\"600\" height=\"636\" border=\"0\" vspace=\"0\" alt=\"10-04.png\"/></p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495106941735680.png\" style=\"width: 600px; height: 1147px;\" title=\"10-06.png\" width=\"600\" height=\"1147\" border=\"0\" vspace=\"0\" alt=\"10-06.png\"/></p><p>4.定时关机功能。晚上上床后还想玩会手机，这个时候就需要这个定时关机的功能了。这里只要设置电脑的关机时间就好了，比如1:00。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495106999164501.png\" style=\"width: 600px; height: 1152px;\" title=\"10-07.png\" width=\"600\" height=\"1152\" border=\"0\" vspace=\"0\" alt=\"10-07.png\"/></p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705181495106999139193.png\" style=\"width: 600px; height: 468px;\" title=\"10-08.png\" width=\"600\" height=\"468\" border=\"0\" vspace=\"0\" alt=\"10-08.png\"/></p><p>如果觉得本站对您有一定的帮助，请到<a href=\"/donate.html\" target=\"_self\">捐助支持</a>页面帮助站长一次，以便我们可持续发展~</p>',1495106357,0,526,'',''),(11,2,1,'',0,0,'',0,1,'路由器配置教程（个人使用版）','本文介绍中南大学移动宽带（和网）如何配置路由器，适用于个人使用版。个人使用版：路由器只能一个人使用，Wi-Fi只能给自己的设备（电脑，手机，平板等）连，是不能分享给别人的。因为后台管理系统里面有个黑名单，限制了一个账号最多只能给两个设备用，如果多了，就会进黑名单，就是账号被停用30分钟。1. 将电脑与路由器的一个lan口相连，wan口空着（如果路由器不同意，就把移动的网线插上），给路由器接通电源。2. 登录路由器的管理后台。首先打开浏览器，输入后台的地址，不同的路由器型号后台管理地址不同，一般会<!--autointro-->','<p>本文介绍中南大学移动宽带（和网）如何配置路由器，适用于个人使用版。</p><p><br/></p><p>个人使用版：路由器只能一个人使用，Wi-Fi只能给自己的设备（电脑，手机，平板等）连，是不能分享给别人的。因为后台管理系统里面有个黑名单，限制了一个账号最多只能给两个设备用，如果多了，就会进黑名单，就是账号被停用30分钟。</p><p><br/></p><p>1. 将电脑与路由器的一个lan口相连，wan口空着（如果路由器不同意，就把移动的网线插上），给路由器接通电源。</p><p>2. 登录路由器的管理后台。首先打开浏览器，输入后台的地址，不同的路由器型号后台管理地址不同，一般会是http://192.168.0.1或者http://192.168.1.1，这两个比较常见，当然也有别的，比如，小米的是http://miwifi.com，极路由的是http://192.168.199.1，甚至可能还有http://10.10.0.1。这里演示用的路由器是斐讯K2，后台地址为http://192.168.2.1。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495282792200873.png\" title=\"001.png\" alt=\"001.png\" width=\"600\" height=\"273\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 273px;\"/></p><p>3.点击快速配置，设置上网方式为自动获取，然后点击下一步。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495282911151779.png\" title=\"002.png\" alt=\"002.png\" width=\"600\" height=\"265\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 265px;\"/></p><p>4. 设置Wi-Fi的名称和密码，一定要设置好这个，被蹭网是有可能进黑名单的。<br/></p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495282973256753.png\" title=\"003.png\" alt=\"003.png\" width=\"600\" height=\"269\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 269px;\"/></p><p>5.稍等1分钟，路由器配置完成。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495283056371463.png\" title=\"004.png\" alt=\"004.png\" width=\"600\" height=\"272\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 272px;\"/></p><p>6. 将移动的线与路由器的wan口相连，重启路由器。有些路由器的界面上有重启的功能，点那个就好了。没有也没关系，把电源拔下来再插上就好了。<br/></p><p>7. 登录账号。一般路由器都会弹出那个界面的，不过有些时候可能不弹，这时候用浏览器访问http://172.1.0.2试试，如果还没有就等电脑网卡识别会，再不行重启电脑。</p><p>如果觉得本站对您有一定的帮助，请到<a href=\"/donate.html\" target=\"_self\">捐助支持</a>页面帮助站长一次，以便我们可持续发展~</p>',1495186764,0,1195,'',''),(12,2,1,'',0,0,'',0,1,'路由器配置教程（多人使用版）','本文介绍中南大学移动宽带（和网）如何配置路由器，适用于多人使用版。多人使用版：路由器可以多人使用，与个人版不同，每个人都要有自己的账号才能使用，也就是说，连接路由器之后还需要登录才能用。1. 将电脑与路由器的一个lan口相连，wan口空着（如果路由器不同意，就把移动的网线插上），给路由器接通电源。2. 登录路由器的管理后台。首先打开浏览器，输入后台的地址，不同的路由器型号后台管理地址不同，一般会是http://192.168.0.1或者http://192.168.1.1，这两个比较常见，当然也<!--autointro-->','<p>本文介绍中南大学移动宽带（和网）如何配置路由器，适用于多人使用版。</p><p><br/></p><p>多人使用版：路由器可以多人使用，与个人版不同，每个人都要有自己的账号才能使用，也就是说，连接路由器之后还需要登录才能用。</p><p><br/></p><p>1. 将电脑与路由器的一个lan口相连，wan口空着（如果路由器不同意，就把移动的网线插上），给路由器接通电源。</p><p>2. 登录路由器的管理后台。首先打开浏览器，输入后台的地址，不同的路由器型号后台管理地址不同，一般会是http://192.168.0.1或者http://192.168.1.1，这两个比较常见，当然也有别的，比如，小米的是http://miwifi.com，极路由的是http://192.168.199.1，甚至可能还有http://10.10.0.1。这里演示用的路由器是斐讯K2，后台地址为http://192.168.2.1。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495283148176222.png\" title=\"001.png\" alt=\"001.png\" width=\"600\" height=\"272\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 272px;\"/></p><p>3.点击快速配置，设置上网方式为自动获取，点击下一步。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495283220275101.png\" title=\"002.png\" alt=\"002.png\" width=\"600\" height=\"268\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 268px;\"/></p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495283296166564.png\" title=\"003.png\" alt=\"003.png\" width=\"600\" height=\"266\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 266px;\"/></p><p>4. 设置wifi的名称和密码。我觉得这个没有设置密码的必要，因为连接路由器之后还要登录宽带账号的，不存在蹭网的问题，也就不会有黑名单了。名称推荐设置成CMCC-CSU，正好与电信的ChinaNet-CSU对应，密码：88888888。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495283259573174.png\" title=\"0003.png\" alt=\"0003.png\" width=\"600\" height=\"273\" border=\"0\" vspace=\"0\" style=\"white-space: normal; width: 600px; height: 273px;\"/></p><p>5.稍等一分钟，路由器配置完成。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495283383323756.png\" title=\"004.png\" alt=\"004.png\" width=\"600\" height=\"273\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 273px;\"/></p><p>6.点击更多设置。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495283422743815.png\" title=\"005.png\" alt=\"005.png\" width=\"600\" height=\"271\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 271px;\"/></p><p>7.点击高级设置。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495283452127354.png\" title=\"006.png\" alt=\"006.png\" width=\"600\" height=\"288\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 288px;\"/></p><p>8.点击内网设置中的DHCP服务，设置成关闭。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495283516144427.png\" title=\"007.png\" alt=\"007.png\" width=\"600\" height=\"292\" border=\"0\" vspace=\"0\" style=\"width: 600px; height: 292px;\"/></p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2017/05/201705201495283535674591.png\" title=\"009.png\" alt=\"009.png\" width=\"600\" height=\"271\" border=\"0\" vspace=\"0\" style=\"width: 600px;