nt-family: &quot;Microsoft Yahei&quot;, &quot;冬青黑体简体中文 w3&quot;, 宋体; white-space: normal; background-color: rgb(245, 245, 245);\">自己省份如果没有飞享8元可以用其他省份尝试强制开通一下～</p>',1515160833,0,237,'',''),(18,2,1,'',0,0,'',0,1,'如何使用极路由取代锐捷客户端登录','本文介绍如何使用极路由内置的锐捷认证功能取代锐捷客户端，并给出一些优化建议。锐捷的客户端破解永远是个经典话题，代代流传，永不停息。到有一天华中科大的一群不知名的程序员们写了一个名叫mentohust的东东，然后就可以在路由器上登录锐捷的校园网了。极路由的锐捷认证也是这样来的。好了，废话不多说，我们来说怎么设置。1.重置路由器（全新的路由器请忽略这里）。按住reset键10秒，然后放开，等待路由器的重启。2.用一根长度合适的网线将校园网的插口和极路由的WAN口相连，再用一个网线将路由器的一个LAN<!--autointro-->','<p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">本文介绍如何使用极路由内置的锐捷认证功能取代锐捷客户端，并给出一些优化建议。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\"><br/></p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">锐捷的客户端破解永远是个经典话题，代代流传，永不停息。到有一天华中科大的一群不知名的程序员们写了一个名叫mentohust的东东，然后就可以在路由器上登录锐捷的校园网了。极路由的锐捷认证也是这样来的。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">好了，废话不多说，我们来说怎么设置。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">1.重置路由器（全新的路由器请忽略这里）。按住reset键10秒，然后放开，等待路由器的重启。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">2.用一根长度合适的网线将校园网的插口和极路由的WAN口相连，再用一个网线将路由器的一个LAN口与电脑的网线插口相连。当然，没有电脑的小伙伴也可以用手机连接WiFi，初始WiFi的名称一般写在极路由的背面，没有密码的。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">3.等待弹出路由器的欢迎界面，也可以直接访问：<a href=\"http://www.oliver.ren/go.php?url=http://hiwifi.com\" target=\"_blank\" style=\"color: rgb(82, 98, 188); text-decoration: none; background-image: url(http://www.oliver.ren/usr/themes/bytecats2/img/blank1.png); padding-right: 10px; margin-right: 2px; background-position: right -18px; background-repeat: no-repeat no-repeat;\">http://hiwifi.com</a>。</p><p><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2018/01/201801061515237917627475.png\" title=\"001.png\" alt=\"001.png\" width=\"615\" height=\"388\" style=\"width: 615px; height: 388px;\"/></p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">4.点击“两部设置，立即上网”。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\"><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2018/01/201801061515237935679107.png\" title=\"002.png\" alt=\"002.png\" width=\"595\" height=\"382\" style=\"width: 595px; height: 382px;\"/></p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">5.点击“立即上网”，设置Wi-Fi的名称和密码，注意这里Wi-Fi的密码就是路由器的后台管理密码。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\"><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2018/01/201801061515237954728616.png\" title=\"003.png\" alt=\"003.png\" width=\"642\" height=\"374\" style=\"width: 642px; height: 374px;\"/></p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">6.点击完成。将会显示Wi-Fi的名称和密码，密码一定要牢记。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\"><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2018/01/201801061515237971773440.png\" title=\"004.png\" alt=\"004.png\" width=\"602\" height=\"414\" style=\"width: 602px; height: 414px;\"/></p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">7.点击“管理路由器后台”。输入管理密码，进行登录。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\"><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2018/01/201801061515237994903992.png\" title=\"005.png\" alt=\"005.png\" width=\"600\" height=\"367\" style=\"width: 600px; height: 367px;\"/></p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">8.点击“互联网”，再点击“MAC地址克隆”。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\"><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2018/01/201801061515238020847046.png\" title=\"006.png\" alt=\"006.png\" width=\"604\" height=\"408\" style=\"width: 604px; height: 408px;\"/></p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">9.选择“复制当前设备”，再点击“保存”。（如果之前使用过锐捷客户端，一定要这样做！）</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\"><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2018/01/201801061515238040207776.png\" title=\"007.png\" alt=\"007.png\" width=\"601\" height=\"368\" style=\"width: 601px; height: 368px;\"/></p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">10.点击“互联网”，再点击“锐捷认证”。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\"><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2018/01/201801061515238060587852.png\" title=\"008.png\" alt=\"008.png\" width=\"602\" height=\"311\" style=\"width: 602px; height: 311px;\"/></p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">11.启用打钩，用户名填宽带账号，密码填宽带密码。IP，子网掩码和网关全部填写“0.0.0.0”，组播地址选择锐捷，DHCP脚本选择标准，DHCP方式选择认证前，客户端版本号填写“5.28”，点击提交。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\"><img src=\"{#ZC_BLOG_HOST#}zb_users/upload/2018/01/201801061515238080513844.png\" title=\"009.png\" alt=\"009.png\" width=\"602\" height=\"397\" style=\"width: 602px; height: 397px;\"/></p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">12.稍等5秒钟，应该就可以上网了，以后也不需要每天登陆了。</p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\"><br/></p><p style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\">注意事项：</p><ol style=\"color: rgb(102, 102, 102); font-family: &quot;microsoft yahei&quot;, Georgia, &quot;Times New Roman&quot;, STHeiti, serif; white-space: normal;\" class=\" list-paddingleft-2\"><li><p>MAC地址以锐捷自助系统里面的1x认证的MAC地址为准；</p></li><li><p>购买极路由的话，推荐去京东购买，而且注意选择自营；</p></li><li><p>如果等了很久还是不能上网，勾选“输出日志”，查看下日志中的错误；</p></li><li><p>如果很多网站打不开，可以换下DNS，使用推荐的114DNS即可；</p></li><li><p>这种做法只是可以不用每天开电脑再开WiFi了，并不能破解锐捷限制连接数。</p></li></ol><p><br/></p><p><span style=\"color: #555555; font-family: 微软雅黑, Arial, sans-serif, Tahoma, &quot;Trebuchet MS&quot;, 宋体; font-size: 16px; text-align: justify; text-inden